import Footerterms from "./Footerterms/Footerterms";

import FooterDataTerms from "../../Data/Footer/FooterDataTerms";
import "./Footer.css";

const Footer = () => {
    let footertermscollezone = FooterDataTerm.map(terms => {
        return <FooterDataTerms termsPoliciy={terms.termlink}/>
    })

    return(
        <footer className="footer">
            <div className="footer__terms">
            <ul>
            <li>{termsPoliciy}</li>
        </ul>
            </div>
            <div className="footer__socialLinks">
                
            </div>
        </footer>
    )
}
export default Footer;
